SELECT * FROM REVIEW

DROP TABLE REVIEW

CREATE TABLE REVIEW(
					REVIEW_NUMBER NUMBER,								-- 게시글 번호
					REVIEW_ID VARCHAR2(100)					NOT NULL,	-- 작성자 아이디
					PLACE_NAME VARCHAR2(100)				NOT NULL,	-- 여행지 장소 이름
					REVIEW_DATE DATE	DEFAULT SYSDATE,				-- 작성일자(기본값 sysdate)
					START_LOCATION VARCHAR2(200)			NOT NULL,	-- 출발지 
					DEST_LOCATION VARCHAR2(200)				NOT NULL,	-- 목적지
					TRAVEL_TIME NUMBER,									-- 여행 소요시간
					BREAK_TIME NUMBER,									-- 휴식시간
					REVIEW_SCORE NUMBER						NOT NULL,	-- 평점
					REVIEW_TITLE VARCHAR2(100)				NOT NULL,	-- 게시글 제목
					REVIEW_CONTENTS VARCHAR2(2048),						-- 게시글 내용
					MAP_LAT FLOAT,										-- 여행지 위도
					MAP_LONG FLOAT,										-- 여행지 경도
					REVIEW_IMAGE VARCHAR2(100),							-- 여행지 대표사진 파일 경로
					
					CONSTRAINT REVIEW_NUMBER_PK PRIMARY KEY (REVIEW_NUMBER),
					CONSTRAINT REVIEW_ID_FK FOREIGN KEY (REVIEW_ID)
					REFERENCES MEMBER (MEMBER_ID)
)

DROP SEQUENCE REVIEW_NUM

create sequence review_num
	start with 1
	increment by 1

